description:
a. thanh toán đầy đủ và đúng hạn số tiền mua căn hộ và kinh phí bảo trì phần sở hữu chung 02%theo thỏa thuận tại điều 3 của hợp đồng này không phụ thuộc vào việc có hay không có thôngbáo thanh toán tiền muacăn hộ của bên bán;
căn hộ biển cao cấp welltone luxury residence sở hữu lâu dài ở nha trang
b. nhận bàn giao căn hộ theo thỏa thuận trong hợp đồng này;c. kể từ ngày nhận bàn giao căn hộ, bên mua hoàn toàn chịu trách nhiệm đối với căn hộ đã mua vàtự chịu trách nhiệm về việc mua, duy trì các hợp đồng bảo hiểm cần thiết đối với mọi rủi ro, thiệthại liên quan đến căn hộ và bảo hiểm trách nhiệm dân sự phù hợp với quy định của pháp luật;d. kể từ ngày nhận bàn giao căn hộ, kể cả trường hợp bên mua chưa vào sử dụng căn hộ thì cănhộ sẽ được quản lý và bảo trì theo nội quy quản lý sử dụng nhà chung cư và bên mua phải tuânthủ các quy định được nêu trong bản nội quy quản lý sử dụng nhà chung cư;e. thanh toán các khoản thuế, phí và lệ phí theo quy định của pháp luật mà bên mua phải nộp nhưthỏa thuận tại điều 7 của hợp đồng này;f. thanh toán các khoản chi phí dịch vụ như: điện, nước, truyền hình cáp, truyền hình vệ tinh, thôngtin liên lạc ... và các khoản thuế, phí khác phát sinh do nhu cầu sử dụng của bên mua theo quyđịnh;g. thanh toán kinh phí quản lý vận hành nhà chung cư và các chi phí khác theo thỏa thuận quy địnhtại khoản 5 điều 11 của hợp đồng này, kể cả trường hợp bên mua không sử dụng căn hộ đãmua;14h. chấp hành các quy định của quy chế quản lý sử dụng nhà chung cư theo quy định pháp luật vàbản nội quy quản lý sử dụng nhà chung cư đính kèm theo hợp đồng này;i. tạo điều kiện thuận lợi cho doanh nghiệp quản lý vận hành trong việc bảo trì, quản lý vận hànhnhà chung cư;j. sử dụng căn hộ đúng mục đích để ở theo quy định của luật nhà ở và theo thỏa thuận trong hợpđồng này;k. nộp phạt vi phạm hợp đồng và bồi thường thiệt hại cho bên bán khi vi phạm các thỏa thuậnthuộc diện phải nộp phạt hoặc bồi thường theo quy định trong hợp đồng này hoặc theo quyết địnhcủa cơ quan nhà nước có thẩm quyền;l. thực hiện các nghĩa vụ khác theo quyết định của cơ quan nhà nước có thẩm quyền khi vi phạmcác quy định về quản lý, sử dụng nhà chung cư;m. trước khi căn hộ được bàn giao cho bên mua, bên mua sẽ không có quyền ra vào hoặc cư trúhoặc sử dụng căn hộ nếu không được bên bán đồng ý trước bằng văn bản.n. trong quá trình sử dụng căn hộ, nếu bên mua có nhu cầu tự nâng cấp, cải tạo, sửa chữa hoặcthay đổi kiến trúc bên trong căn hộ thì bên mua phải làm văn bản đề nghị bên bán (khi chưathành lập ban quản trị nhà chung cư) hoặc ban quản lý xem xét. công việc này chỉ được thựchiện sau khi có sự đồng ý bằng văn bản của bên bán hoặc ban quản lý nhà chung cư để khônggây ảnh hưởng hoặc gây thiệt hại cho các khu vưc liền kề, cũng như kiến trúc và thẩm mỹ của dựán đồng thời phải tuân thủ các yêu cầu kỹ thuật xây dựng của pháp luật khi tiến hành các côngviệc đó. trường hợp bên mua sửa chữa, cải tạo, lắp đặt thiết bị bên trong căn hộ không làm thayđổi kết cấu chịu lực, không làm thay đổi công năng sử dụng, không làm ảnh hưởng tới môitrường, an toàn công trình thì bên mua chỉ cần thông báo tối thiểu 03 (ba) ngày trước ngày thicông, sửa chữa cho bên bán hoặc ban quản lý nhà chung cư.o. cung cấp và ký kết các tài liệu liên quan đến việc chuyển giao, công chứng và đăng ký quyền sởhữu căn hộ theo yêu cầu của bên bán và các cơ quan nhà nước có thẩm quyền; phối hợp chặt chẽvới bên bán trong quá trình thực hiện thủ tục xin cấp giấy chứng nhận. trường hợp bên muakhông hoàn thành hoặc chậm trễ trong việc phối hợp với bên bán để hoàn tất các thủ tục xin cấpgiấy chứng nhận, bên mua sẽ phải chịu mọi rủi ro, chi phí và trách nhiệm phát sinh;p. bên mua có trách nhiệm nộp thuế (nếu pháp luật có quy định) đối với các khoản tiền phạt viphạm, tiền bồi thường thiệt hại nhận được từ bên bán;q. phải từ bỏ các quyền liên quan đến căn hộ sau khi bên bán hoặc bên mua thực hiện quyền đơnphương chấm dứt hợp đồng theo thỏa thuận trong hợp đồng;r. bảo đảm đáp ứng đầy đủ các điều kiện theo quy định của pháp luật để ký và thực hiện hợp đồng;có đầy đủ điều kiện được cấp giấy chứng nhận theo quy định pháp luật. chỉ định bên thứ ba đủđiều kiện nhận chuyển nhượng căn hộ/hợp đồng theo quy định pháp luật trong trường hợp bất kỳchủ thể nào của bên mua không đủ điều kiện được cấp giấy chứng nhận tại thời điểm bên bánthực hiện thủ tục cấp giấy chứng nhận. việc chỉ định này phải được thực hiện theo đúng trình tự,thủ tục của pháp luật về chuyển nhượng hợp đồng mua bán căn hộ;s. thực hiện các nghĩa vụ khác theo quy định của pháp luật và thỏa thuận tại hợp đồngwelltone luxury residence
